import base64
from PIL import Image
import io
import matplotlib.pyplot as plt
from flask import jsonify
from transformers import TrOCRProcessor, VisionEncoderDecoderModel
processor = TrOCRProcessor.from_pretrained('microsoft/trocr-base-handwritten')
model = VisionEncoderDecoderModel.from_pretrained('microsoft/trocr-base-handwritten')


def convertToImage(base64text):
    image_data = base64.b64decode(base64text[17:])
    image = Image.open(io.BytesIO(image_data)).convert("RGBA")
    width, height = image.size
    background = Image.new("RGBA", (width, height), (255, 255, 255, 255))
    background.paste(image, (0, 0), image)

    return background.convert("RGB")

# Example base64 image string (replace with your actual base64 string)
base64text = "image/png;base64,"

# Convert and display the image
image = convertToImage(base64text)
def process_image(image):

    print("image converted")
    pixel_values = processor(images=image, return_tensors="pt").pixel_values
    generated_ids = model.generate(pixel_values)
    generated_text = processor.batch_decode(generated_ids, skip_special_tokens=True)[0]

    return generated_text
#print(process_image(image))
# Display the image using matplotlib
plt.imshow(image)
plt.axis('off')  # Hide axes
plt.show()
